import React from "react";
import Layout from "../../../Common/Component/Layout";
import EventBingo1 from "../../../Image/event4_01.png";
import EventBingo2 from "../../../Image/event4_02.png";
import EventBingo3 from "../../../Image/event4_03.png";
import bingoCompleteImg from "../../../Image/bingo_complete.png";
import { WIZLIVE_BANNER_LINK } from "../../../Common/Util/Constant";
import "./index.scss";

export default function View(props) {
  const { userId, missions, lines, allCompletedCount } = props;
  let lineSvgs = [
    <line key={0} x1="0" y1="0" x2="100%" y2="0" strokeWidth="12px" />, // - 1
    <line key={1} x1="0" y1="50%" x2="100%" y2="50%" strokeWidth="6px" />, // - 2
    <line key={2} x1="0" y1="100%" x2="100%" y2="100%" strokeWidth="12px" />, // - 3
    <line key={3} x1="0" y1="0" x2="0" y2="100%" strokeWidth="12px" />, // | 1
    <line key={4} x1="50%" y1="0" x2="50%" y2="100%" strokeWidth="6px" />, // | 2
    <line key={5} x1="100%" y1="0" x2="100%" y2="100%" strokeWidth="12px" />, // | 3
    <line key={6} x1="0" y1="0" x2="100%" y2="100%" strokeWidth="6px" />, // \
    <line key={7} x1="0" y1="100%" x2="100%" y2="0" strokeWidth="6px" /> // /
  ];

  return (
    <Layout>
      <div className="Page--Event4Detail">
        <div className="Event4_Inner">
          <div className="Event4_Section">
            <img src={EventBingo1} alt="event4_01" />
          </div>
          <div className="Event4_Section Event4_Missions">
            <div className="Event4_Missions_Title">
              <img
                className="Event4_Missions_Img"
                src={EventBingo3}
                alt="event4_03"
              />
            </div>
            <div className="Event4_MissionItems">
              {missions.map((mission, i) => {
                return (
                  <div key={i} className="Event4_Mission">
                    <div className="Event4_Mission_Inner">
                      <div className="Event4_Mission_Title">
                        {mission.isClear && (
                          <div className="Event4_Mission_Clear">
                            <img src={bingoCompleteImg} alt="complete" />
                          </div>
                        )}
                        {mission.title}
                        {i === 4 && (
                          <a
                            href={WIZLIVE_BANNER_LINK(userId)}
                            className="Event4_Wizlive"
                            target="_blank"
                            rel="noopener noreferrer"
                          >
                            위즈라이브 GO
                          </a>
                        )}
                      </div>
                    </div>
                  </div>
                );
              })}
            </div>
            <div className="Event4_Missions_Lines">
              <svg>
                {lineSvgs.map((line, i) => {
                  return lines[i] ? line : "";
                })}
              </svg>
            </div>
            <div className="Event4_Mission_Wrapper">
              <div className="Event4_Mission_Count">
                <p className="Event4_Mission_Text">
                  8 빙고를 달성한 사람은{" "}
                  <span className="Event4_Mission_Counts">
                    {allCompletedCount}
                  </span>
                  명 입니다.
                </p>
              </div>
            </div>
          </div>
          <div className="Event4_Section">
            <img src={EventBingo2} alt="event04_02" />
          </div>
        </div>
      </div>
    </Layout>
  );
}
